【ケロッグ フルーツグラノラ ハーフ 徳用袋の詳細】<br>
低脂肪の穀物とフルーツを厳選し、調合する油を極力カットすることで、おいしさはそのままに、脂質を半分以下にグーンと抑えてヘルシーに仕上げました。 ほどよい甘さのサクサク食感のグラノラに、人気のブルーベリーとマンゴーをはじめ、ストロベリー、クランベリー、レーズンの5種のフルーツを贅沢にミックスしました。6種のビタミン(ビタミンB1, B2, B6 , ナイアシン, 葉酸, E)、鉄分、食物繊維など栄養バランス満点です。<br><br>

【原材料】<br>
シリアルフレーク（コーングリッツ（非遺伝子組換え）・砂糖・精米・小麦・麦芽エキス・食塩・小麦グルテン・麦芽粉・脱脂粉乳・ぶどう糖果糖液糖）、大麦、シリアルパフ（米粉・小麦粉・砂糖・麦芽粉・コーンフラワー・食塩・植物油脂）、砂糖、ドライフルーツ（レーズン・マンゴー・ブルーベリー・ストロベリー・クランベリー）、水あめ、植物油脂、小麦粉、糖蜜、蜂蜜、でん粉、麦芽エキス、食塩、キャラメル、デキストリン、グリセリン、香料、乳化剤、炭酸Ca、ビタミンC、酸化防止剤（ビタミンE・亜硫酸塩)、酸味料、ピロリン酸鉄、ナイアシン、トコフェロール酢酸エステル、鉄、ビタミンB2、ビタミンB6、ビタミンB1、ビタミンA、ビタミンD、ビタミンB12、葉酸、（原材料の一部に大豆を含む）<br><br>

【アレルギー物質】<br>
小麦、乳、大豆<br><br>

【栄養成分】1回の摂取量含有の栄養素：40g<br>
エネルギー：154.0kcaL、たんぱく質：2.4g、脂質：1.4g、糖質：32.5g、食物繊維：1.4g、ナトリウム：151mg、ビタミンE：2.4mg、鉄：1.9mg、ビタミンB1：0.25mg、ビタミンB2：0.28mg、ナイアシン：2.8mg、ビタミンB6：0.25mg、葉酸：60μg<br><br>

【ご注意】<br>
○本品は、多量摂取により疾病が治癒したり、より健康が増進するものではありません。1日の摂取目安量を守ってください。<br>
○本品は、特定保健用食品と異なり、消費者庁長官による個別審査を受けたものではありません。<br><br>

【賞味期限】<br>
パッケージに記載<br><br>

【内容量】<br>
500g×63個<br><br>

【販売元】<br>
